const Header = (props) => {
  return (
    <div>
        <p>
        {props.header}
      </p>
    </div>
  )
}
const Content = (props) => {
  return (
    <div>
        <p>
        {props.content}
      </p>
    </div>
  )
}
const Total = (props) => {
  return (
    <div>
        <p>
        {props.total}
      </p>
    </div>
  )
}


const App = () => {
  const course = 'Half Stack application development'
  const part1 = 'Fundamentals of React'
  const exercises1 = 10
  const part2 = 'Using props to pass data'
  const exercises2 = 7
  const part3 = 'State of a component'
  const exercises3 = 14

  return (
    <div>
      <h1>{course}</h1>
        <Header header={part1}/> <Content content={exercises1}/>
        <Header header={part2}/> <Content content={exercises2}/>
        <Header header={part3}/> <Content content={exercises3}/>
      <p>Number of exercises {exercises1 + exercises2 + exercises3}</p>
    </div>
  )
}

export default App
